import React from 'react';
import PropTypes from 'prop-types';

//different versions of the button
const buttonStyles = new Set(["btn--default", "btn--clicked"]);

function SidebarButton(props: SBBProps) {

    const checkButtonStyle = buttonStyles.has(props.buttonStyle) ? props.buttonStyle : "btn--default";

    return(
    <button className={checkButtonStyle}></button>
    )
}

export default SidebarButton;

interface SBBProps {
    name?: string;
    buttonStyle: string;
    key?: number;
}
